import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const Id = styled.div``;
const H1 = styled.h1``;

const ExercisePresenter = id => {
  return (
    <Id>
      <>{this.props.name}</>
    </Id>
  );
};
ExercisePresenter.propTypes = {
  name: PropTypes.number
};

export default ExercisePresenter;
